const initialState = {
    counterRedux : 0 
}



const reducer = (state = initialState , action) => {
    switch (action.type) {
        case 'INCREMENT':            
            return {
                counterRedux : state.counterRedux + 1
            };
        default:
            break;
    }    
    return state;
}


export default reducer;
